import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<nav>
  <ul class="flex flex-row space-x-10 font-semibold text-xl uppercase">
    <li class="cursor-pointer"><a routerLink="/home">Home</a></li>
    <li class="cursor-pointer"><a routerLink="/profile">Profile</a></li>
    <li class="cursor-pointer"><a routerLink="/artists">Artists</a></li>
  </ul>
</nav>
